    return (<form className="place-form">
        <Input 
            id="title"
            element="input" 
            type="text" 
            validators={[VALIDATOR_REQUIRE()]} 
            label="Title" 
            errorText="Please enter a valid title..." 
            onInput={titleInputHandler}
        /> 
         <Input 
            id="description"
            element="textarea" 
